                icon: 'warning',
                buttons: true,
                dangermode: true,
            })
                .then((willDelete) => {
                    if (willDelete) {

                        $.ajax({
                            url: ""/Admin/Hayvan/SilSahiplendirilecekHayvan/"",
                            type: ""POST"",
                            data: { id: id },
                            success: function (result) {
                                location.reload();
                            }
                        });
                    }
                    else {
                        location.reload();
                    }
                });
        }
    }
</script>

